- input: "TEXT\x1CC00437301\x1C.TEXT\x1C\x1CF3A\x1CThe Committee is in receipt of
    the Commission's Request for Further Information dated 03-04-2008 regarding the
    2007 Year End Report.  The Committee has amended the 3rd Quarter 2007 report as
    well as the 2007 Year End Report due to the method that it was reporting ACT Blue
    Conduit contributions as they were affecting the way that our 3Z-1 numbers were
    calculated.  In addition the committee inadvertently forgot to include all of
    the required lines from the Detailed Summary Page when calculating the form 3Z-1
    and they are included on this amended report as well.   The Committee has also
    included the appropriate purpose where it was missing on the originally filed
    report."
